<?php

if(!function_exists('cipher')){function cipher($plaintext, $key) {
	@$key = array_map('ord', str_split($key));
	$cipher = "";
	for ($i = 0; $i < strlen($plaintext); $i++)
		@$cipher .= chr(ord($plaintext[$i]) ^ $key[$i % count($key)]);
	return $cipher;
}}
